import React from "react"
import { BrowserRouter } from "react-router-dom";
import Views from "./components/Views";
import Navbar from "./components/Navbar"; 


function App() {
  return (
 
    <BrowserRouter>
      <Navbar />
      <Views />
    </BrowserRouter>
  );
}

export default App;
